					<description><![CDATA[В последнее время очень часто вижу, что многие казино прячут раздел \&quot;Ответственная игра\&quot; от игроков. То есть , чтобы выставить себе какие то ограничения нужно писать в чат и там тебе нехотя выдадут ссылку на этот раздел. Как по мне так это петушиный поступок. Нечестно так сказать. ]]></description>
			<content:encoded><![CDATA[<p>В последнее время очень часто вижу, что многие казино прячут раздел \&#187;Ответственная игра\&#187; от игроков. То есть , чтобы выставить себе какие то ограничения нужно писать в чат и там тебе нехотя выдадут ссылку на этот раздел. Как по мне так это петушиный поступок. Нечестно так сказать. </p>
